import { Component } from '@angular/core';
import dataObj from '../assets/api-response.json';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'rouse-challenge';
  data: DataPoint[];
  modelIds: any[];
  constructor() {
    this.data = []
    this.modelIds = []
    // Object.keys(dataObj).map((key, i, a) => {
    //   let id: any = dataObj[key as keyof typeof DataPoint].classification.model
    //   this.data.push(id);
    //   return this.data;
    // });

    const keys = Object.keys(dataObj) as (keyof typeof dataObj)[];
    console.log(keys);

    keys.forEach((key) => {
      console.log(key, dataObj[key]);
      this.data.push({
        key: dataObj[key]
      });
    });
  }


}

interface DataPoint  {
  key:{
        schedule: {
            years: {
                // year: {
                //     marketRatio: number;
                //     auctionRatio: number;
                // };
            };
            defaultMarketRatio: number;
            defaultAuctionRatio: number;
        };
        saleDetails: {
            cost: number;
            retailSaleCount: number;
            auctionSaleCount: number;
        };
        classification: {
            category: string;
            subcategory: string;
            make: string;
            model: string;
    };
  };
};
